import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import React, { useEffect, useState } from "react";


type State = {
    stateText: string,
    count: number
}
export default function BoxState(stateType: State){

        const  [numberState, setNumber] = useState(0);

        for (let index = 0; index < stateType.count; index++) {

           useEffect(() => {
            setNumber(index)
           }, [], )

        }

    return (<>
                 <div className=" w-72 h-28 bg-white rounded-xl flex flex-row justify-between p-3 relative">
                            <div>
                            <FontAwesomeIcon icon={faFolder} className="text-blue-400 text-5xl absolute border p-3 bg-white outline outline-8 outline-slate-200 rounded-full border-slate -top-4 -left-4" />
