                                <div className="flex flex-col ml-3">
                                    <h4 className="text-4xl laila-bold text-gray-700">
                                       {numberState}
                                        </h4>
                                    <p className="text-md text-gray-400">{stateType.stateText}</p>
                                </div>
                            </div>
                        </div>

    </>)
}
